select 'JV85', day, start_hr, start_min from time_slot where (time_slot.day,time_slot.start_hr,time_slot.start_min) not in (select day,start_hr,start_min from ((select * from course natural inner join section where dept_name='Comp. Sci.') as a1 left outer join time_slot on a1.time_slot_id=time_slot.time_slot_id) as cs1)
